import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import * as serviceWorker from './serviceWorker';

import AppStore from './App Store.png'
import Calendar from './Calendar Official.png'

const IconButton = ({img, name}) => {
  return (
    <article className="icon">
      <img src={img} alt="icon"></img>
      <h4>{name}</h4>
    </article>
  );
};


const AppList = () => {
  return (
    <section className="background_ios">
      <IconButton img={AppStore} name="App Store"></IconButton>
      <IconButton img={Calendar} name="Calendar"></IconButton>
    </section>
  );
}

ReactDOM.render(<AppList />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
